import React from 'react'

const Card = ({card_number}) => {
    return (
        <div style={styles.card}>
            {card_number}
        </div>
    )
}

const styles = {
    card : {
        width: "350px",
        height: "300px",
        backgroundColor: "blue",
        border: "2px solid black",
        borderSizing: "border-box",
        fontSize: "2.5em",
        color: "white" 
    }
}


export default Card
